import styled from 'styled-components'

const WeatherLogo = styled.img`
width: 200px;
height: 200px;
margin: 60px auto;
`;

const ChooseCityLabel = styled.span`
color: black;
font-size: 20px;
font-weight: bold;
margin: 10px auto;
`;

const SearchBox = styled.form`
display: flex;
flex-direction: row;
border: black solid 1px;
border-radius: 5px;
color: black;
font-size: 20px;
font-weight: bold;
margin: 30px auto;
& input
`;

const CityComponent = () => {
    return(
        <>
        <WeatherLogo src="/icons/perfect-day.svg"/>
        <ChooseCityLabel>Weather of City</ChooseCityLabel>
        <SearchBox>
            <input placeholder='City'/>
            <button>Search</button>
        </SearchBox>
        </>
    );

};
export default CityComponent
